class GoddardRenderer {
    constructor() {
        this.sLightScaleColours = [{ r: 0.0, g: 0.0, b: 0.0 }, { r: 0.0, g: 0.0, b: 0.0 }]
        this.sLightDirections = [{ x: 0.0, y: 0.0, z: 0.0 }, { x: 0.0, y: 0.0, z: 0.0 }]
        this.sDynDlSet1 = [null, null]
        this.sMHeadMainDls = [null, null]
        this.D_801BD7C8 = new Array(3).fill(0).map(() => new Array(2).fill(0))
        this.sGdDLArray = new Array(1000)
    }


    setup_view_buffers(name, view) {

        if (view.flags & (GDTypes.VIEW_Z_BUF | GDTypes.VIEW_COLOUR_BUF) && !(view.flags & GDTypes.VIEW_UNK_1000)) {
            if (view.flags & GDTypes.VIEW_COLOUR_BUF) {
                view.parent = view
            } else {
                view.parent = this.sScreenView2
            }

            throw "more implementation needed in setup view buffers"
        } else {
            view.parent = this.sScreenView2
        }

        view.gdGlNum = 0
        view.unk74 = 0

        if (view.flags & GDTypes.VIEW_DEFAULT_PARENT) {
            throw "more implementation D_801A86E0"
            view.parent = D_801A86E0
        }
    }

    setup_stars() {
        this.gShapeRedStar = Shapes.make_shape(0, "redstar")
        this.gShapeRedStar.gdDls[0] = this.new_gddl_from(null)
        this.gShapeRedStar.gdDls[1] = this.gShapeRedStar.gdDls[0]
        this.sGdDLArray[this.gShapeRedStar.gdDls[0]].dlptr = gd_red_star_dl_array
        this.sGdDLArray[this.gShapeRedStar.gdDls[1]].dlptr = gd_red_star_dl_array

        this.gShapeSilverStar = Shapes.make_shape(0, "silverstar")
        this.gShapeSilverStar.gdDls[0] = this.new_gddl_from(null)
        this.gShapeSilverStar.gdDls[1] = this.gShapeSilverStar.gdDls[0]
        this.sGdDLArray[this.gShapeSilverStar.gdDls[0]].dlptr = gd_silver_star_dl_array
        this.sGdDLArray[this.gShapeSilverStar.gdDls[1]].dlptr = gd_silver_star_dl_array

        this.gShapeRedSpark = Shapes.make_shape(0, "sspark")
        this.gShapeRedSpark.gdDls[0] = this.new_gddl_from(null)
        this.gShapeRedSpark.gdDls[1] = this.gShapeRedSpark.gdDls[0]
        this.sGdDLArray[this.gShapeRedSpark.gdDls[0]].dlptr = gd_red_sparkle_dl_array
        this.sGdDLArray[this.gShapeRedSpark.gdDls[1]].dlptr = gd_red_sparkle_dl_array

        this.gShapeSilverSpark = Shapes.make_shape(0, "rspark")
        this.gShapeSilverSpark.gdDls[0] = this.new_gddl_from(null)
        this.gShapeSilverSpark.gdDls[1] = this.gShapeSilverSpark.gdDls[0]
        this.sGdDLArray[this.gShapeSilverSpark.gdDls[0]].dlptr = gd_silver_sparkle_dl_array
        this.sGdDLArray[this.gShapeSilverSpark.gdDls[1]].dlptr = gd_silver_sparkle_dl_array
    }

    new_gddl_from(dl) {
        const gddl = this.new_gd_dl(0, 0, 0, 0, 0, 0)
        gddl.gfx = dl
        return gddl.number
    }


    new_gd_dl(id, gfxs, verts, mtxs, lights, vps) {

        const dl = {
            id,
            number: this.sGdDlCount++,
            parent: null,
            vtx: [],

            mtx: [],

            light: [],

            gfx: [],

            dlptr: null,

            vp: [],

            number: 0,

        }
        this.sGdDLArray[dl.number] = dl


        if (verts == 0) verts = 1
        dl.vtx = new Array(verts)

        if (mtxs == 0) mtxs = 1
        dl.mtx = new Array(mtxs)

        if (lights == 0) lights = 1
        dl.light = new Array(lights)

        if (gfxs == 0) gfxs = 1
        dl.gfx = new Array(gfxs)

        if (vps == 0) vps = 1
        dl.vp = new Array(vps)

        return dl

    }

    create_child_gdl(id, srcDL) {
        const newDl = {
            parent: srcDL,
            id,
            number: this.sGdDlCount++,
            vtx: [],
            mtx: [],
            light: [],
            gfx: [],
            vp: []
        }
        this.sGdDLArray[newDl.number] = newDl

        return newDl
    }

    gd_init() {
        this.D_801BB184 = 0xff
        this.D_801A867C = 0
        this.D_801A8680 = 0
        this.D_801A86A0 = 0
        this.gGdFrameBuf = 0
        this.D_801A86BC = 1
        this.sItemsInMenu = 0
        this.D_801A86F0 = 0
        this.sNewZPresses = 0
        this.sGdDlCount = 0
        this.D_801A8674 = 0
        this.sLightId = 0
        this.sAmbScaleColour = { r: 0.0, g: 0.0, b: 0.0 }

        for (let i = 0; i < 2; i++) {
            this.sLightScaleColours[i] = { r: 1.0, g: 0.0, b: 0.0 }
            this.sLightDirections[i] = { x: 0.0, y: 120.0, z: 0.0 }
        }

        this.sNumLights = 2
        this.sIdnMtx = new Array(4).fill(0).map(() => new Array(4).fill(0))
        MathUtil.mtxf_identity(this.sIdnMtx)
        Objects.null_obj_lists()

        this.sStaticDl = this.new_gd_dl(0, 1900, 4000, 1, 300, 8)
        this.sDynDlSet1[0] = this.new_gd_dl(1, 600, 10, 200, 10, 3)
        this.sDynDlSet1[1] = this.new_gd_dl(1, 600, 10, 200, 10, 3)

        this.sMHeadMainDls[0] = this.new_gd_dl(1, 100, 0, 0, 0, 0)
        this.sMHeadMainDls[1] = this.new_gd_dl(1, 100, 0, 0, 0, 0)

        this.D_801BD7C8.forEach(x => {
            x[0] = this.create_child_gdl(1, this.sDynDlSet1[0])
            x[1] = this.create_child_gdl(1, this.sDynDlSet1[1])
        })

        this.sScreenView2 = Objects.make_view("screenview2", (GDTypes.VIEW_2_COL_BUF | GDTypes.VIEW_UNK_1000 | GDTypes.VIEW_COLOUR_BUF | GDTypes.VIEW_Z_BUF), 0, 0, 0, 320, 240, null)

        this.sScreenView2.colour = { r: 0.0, g: 0.0, b: 0.0 }
        this.sScreenView2.parent = this.sScreenView2
        this.sScreenView2.flags &= ~GDTypes.VIEW_UPDATE

        this.gGdCtrl = {
            unk88: 1.0,
            unkA0: -45.0,
            unkAC: 45.0,
            unk00: 2,
            newStartPress: false,
            prevFrame: null,
            csrX: 160,
            csrY: 120,
            frameAbtnPressed: -1000
        }
    }

    gdm_maketestdl(id) {
        switch (id) {
            case 2: // Regular face
                if (this.sMarioSceneGrp == null) {
                    Shapes.load_mario_head(Shapes.animate_mario_head_normal)
                    this.sMarioSceneGrp = this.gMarioFaceGrp
                    //this.gd_setup_cursor() TODO
                }
                break
            default:
                throw "unimplemented mario head"
        }
    }

    gdm_setup() {
        this.gd_init()
        Shapes.load_shapes2()
        this.setup_stars()
    }
}

export const GoddardRendererInstance = new GoddardRenderer()
